import static org.junit.jupiter.api.Assertions.*;
import static org.mockito.ArgumentMatchers.*;
import static org.mockito.Mockito.*;
import java.util.Locale;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import org.springframework.format.ParseException;
import org.springframework.samples.petclinic.owner.PetType;
import org.springframework.samples.petclinic.owner.PetTypeFormatter;
import org.springframework.samples.petclinic.owner.PetTypeRepository;

@ExtendWith(MockitoExtension.class)
public class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter instance;

	@Test
	@DisplayName("Print returns string for given pet type and locale")
	void testPrintHappyPath() {
		PetType petType = new PetType();
		String result = instance.print(petType, Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Print throws NullPointerException for null pet type")
	void testPrintEdgeCase() {
		assertThrows(NullPointerException.class, () -> instance.print(null, Locale.ENGLISH));
	}

	@Test
	@DisplayName("Parse returns pet type for valid text and locale")
	void testParseHappyPath() {
		PetType petType = new PetType();
		when(types.findPetTypeByName("Cat")).thenReturn(petType);
		PetType result = instance.parse("Cat", Locale.ENGLISH);
		assertEquals(petType, result);
		verify(types).findPetTypeByName("Cat");
	}

	@Test
	@DisplayName("Parse throws ParseException for invalid text")
	void testParseEdgeCase() {
		when(types.findPetTypeByName("Invalid")).thenReturn(null);
		assertThrows(ParseException.class, () -> instance.parse("Invalid", Locale.ENGLISH));
	}

}
